import React, { useEffect, useState, useCallback } from 'react';
import { connectWebSocket, disconnectWebSocket, sendWebSocketMessage } from '../webSocketService';
import ToDo from './ToDo';
import { updateTask } from '../api';
import { startOfToday, isAfter } from 'date-fns';

export default function ToDoList({ todos = [], setTasks, isDeleteMode, onEditTodo, selectedCategory, handleDeleteTask, userId }) {
  const [selectedTodoId, setSelectedTodoId] = useState(null);

  const fetchTodos = useCallback(() => {
    console.log(`Fetching todos for user ID: ${userId}`);
    fetch(`/api/v1/task/getTasks?userId=${userId}`)
      .then(response => response.json())
      .then(data => {
        console.log('Fetched todos:', data);
        setTasks(data);
      })
      .catch(error => console.error('Error fetching tasks:', error));
  }, [userId, setTasks]);

  const handleMessageReceived = useCallback((message) => {
    console.log("WebSocket message received:", message);
    if (message.type === 'TASK_UPDATE') {
      updateTaskInState(message.task);
    }
  }, []);

  const updateTaskInState = useCallback((updatedTask) => {
    console.log('Updating task in state:', updatedTask);
    setTasks(prevTodos => {
      const todos = prevTodos.map(task =>
        task.taskId === updatedTask.taskId ? updatedTask : task
      );
      console.log('Updated todos:', todos);
      return todos;
    });
  }, [setTasks]);

  useEffect(() => {
    console.log('Connecting to WebSocket and fetching todos');
    connectWebSocket(userId, handleMessageReceived);
    fetchTodos();

    return () => {
      console.log('Disconnecting from WebSocket');
      disconnectWebSocket();
    };
  }, [userId, fetchTodos, handleMessageReceived]);

  const handleCheckboxChange = async (taskId) => {
    console.log('Checkbox changed for ID:', taskId);
    const updatedTodos = todos.map(todo => {
      if (todo.taskId === taskId) {
        const updatedTodo = { ...todo, completed: !todo.completed };
        if (updatedTodo.completed) {
          updatedTodo.categoryId = 7; // Kategorie-ID auf 7 setzen, wenn die Aufgabe abgeschlossen ist
        }
        return updatedTodo;
      }
      return todo;
    });

    setTasks(updatedTodos);

    const updatedTask = updatedTodos.find(todo => todo.taskId === taskId);
    try {
      console.log('Updating task in backend:', updatedTask);
      // Aktualisiere das Backend über REST
      await updateTask(updatedTask, userId);

      // Senden der WebSocket-Nachricht
      console.log('Sending WebSocket message for task update:', updatedTask);
      sendWebSocketMessage('/user/' + userId + '/topic/tasks', { type: 'TASK_UPDATE', task: updatedTask });
      console.log('WebSocket update task successful');
    } catch (error) {
      console.error('Error updating task via WebSocket:', error);
    }
  };

  const handleDeleteClick = async (taskId) => {
    console.log('Deleting task with ID:', taskId);
    try {
      await handleDeleteTask(taskId);
      console.log('Task deleted successfully');
    } catch (error) {
      console.error('Error deleting task:', error.response ? error.response.data : error.message);
    }
  };

  const handleDateChange = async (taskId, date, purpose) => {
    console.log(`Updating ${purpose} date for ID: ${taskId}`);
    const updatedTodos = todos.map(todo => {
      if (todo.taskId === taskId) {
        return {
          ...todo,
          [`${purpose}Date`]: date ? new Date(date).toISOString() : null,
        };
      }
      return todo;
    });

    setTasks(updatedTodos);

    const updatedTask = updatedTodos.find(todo => todo.taskId === taskId);
    try {
      console.log('Sending WebSocket message for date update:', updatedTask);
      // Senden der WebSocket-Nachricht
      sendWebSocketMessage('/user/' + userId + '/topic/tasks', { type: 'TASK_UPDATE', task: updatedTask });
      console.log('WebSocket update date successful');
    } catch (error) {
      console.error('Error updating date via WebSocket:', error);
    }
  };

  const today = startOfToday();

  const filteredTodos = selectedCategory && selectedCategory.name ? todos.filter(todo => {
    switch (selectedCategory.name) {
      case 'Planned':
        return todo.planDate && !todo.completed && isAfter(new Date(todo.planDate), today);
      case 'Today':
        return todo.planDate && !todo.completed && isAfter(new Date(todo.planDate), today) && todo.categoryId !== 7;
      case 'Personal':
      case 'Work':
      case 'Any Time':
        return todo.categoryId === selectedCategory.id;
      case 'All Tasks':
        return !todo.planDate && todo.categoryId !== 7;
      case 'Logbook':
        return todo.categoryId === 7;
      default:
        return todo.categoryId === selectedCategory.id;
    }
  }) : todos;

  return (
    <fieldset>
      <legend className="sr-only">Tasks</legend>
      <div className="space-y-1">
        {filteredTodos.map(todo => (
          <ToDo
            key={todo.taskId}
            todo={todo}
            handleCheckboxChange={() => handleCheckboxChange(todo.taskId)}
            handleTodoClick={() => setSelectedTodoId(todo.taskId === selectedTodoId ? null : todo.taskId)}
            handleDelete={() => handleDeleteClick(todo.taskId)}
            handleEditClick={() => onEditTodo ? onEditTodo(todo) : null}
            isSelected={todo.taskId === selectedTodoId}
            onDateChange={handleDateChange}
            isDeleteMode={isDeleteMode}
            userId={userId}
          />
        ))}
      </div>
    </fieldset>
  );
}
